import React, { useState } from 'react';
import './Form.css';
import { Link } from 'react-router-dom'
import axios from "axios"
import { useNavigate } from "react-router-dom"

const Form = () => {

    const history = useNavigate()

    const [user, setUser] = useState({
        username: "",
        email: "",
        password: "",
        address: "",
        contact_no: "",
        password2: ""
    } )

    const handleSubmit = async(e) =>{
      e.preventDefault();
      const {username, email, password, address, contact_no} = user;
      const response = await fetch("http://localhost:3000/api/auth/createuser",{
       
        method: 'POST',
        headers: {
          'content-Type' : 'application/json'
        },
        body: JSON.stringify({username, email, password, address, contact_no})
      });
    
    const json = await response.json()
    console.log(json);
      localStorage.setItem('token', json.authtoken);
      history.push("/");    
    }

    const handleChange = (e) => {       
        const { username, value} = e.target
        setUser({
              ...user,
              [e.target.username]:e.target.value
        })   
    }
    
  return (
      <div className='form-container'>
        <span className='close-btn'><Link to = "/">x</Link></span>
        <div className='form-content-left'>
          <img className='form-img' src='img/img-2.svg' alt='spaceship' />
        </div>

      <div className='form-content-right'>
      <form className='form' onSubmit={handleSubmit}>
      {console.log("User", user)}
        <h1>
          Get started with us today! Create your account by filling out the
          information below.
        </h1>

        <div className='form-inputs'>
          <label className='form-label'>Username</label>   
          <input
            className='form-input'
            type='text'
            name='username'
            placeholder='Enter your username'
            id="username" onChange={handleChange}
          />
        </div>

        <div className='form-inputs'>
          <label className='form-label'>Email</label>
          <input
            className='form-input'
            type='email'
            name='email'
            placeholder='Enter your email'
            id="email" onChange={handleChange}
            
          />

        <div className='form-inputs'>
          <label className='form-label'>Password</label>
          <input
            className='form-input'
            type='password'
            name='password'
            placeholder='Enter your password'
            id="password" onChange={handleChange}
          />
        </div>

        <div className='form-inputs'>
          <label className='form-label'>Address</label>   
          <input
            className='form-input'
            type='text'
            name='address'
            placeholder='Enter your Address'
            id="address" onChange={handleChange}
          />
        </div>

        <div className='form-inputs'>
          <label className='form-label'>Contact No</label>   
          <input
            className='form-input'
            type='text'
            name='contact_no'
            placeholder='Enter your contact'
            id="contact_no" onChange={handleChange}
          />
        </div>

        <div className='form-inputs'>
          <label className='form-label'>Confirm Password</label>
          <input
            className='form-input'
            type='password'
            name='password2'
            placeholder='Confirm your password'
            id="password2" onChange={handleChange}
          />
        </div>

        <button className='form-input-btn' type='submit' >Sign up</button>
        <br></br>
        <span className='form-input-login'> Already have an account? Login <a href='Login'>here</a></span>

        </div>
      </form>
      </div>
      </div>
  );
};

export default Form;
